import React, {Component} from 'react';

import './Welcome.css';
import play from './play.json';
const assets = play.assets;

class Welcome extends Component {
	render() {
		return (
            <ul>
                {assets.map(s => (<li>{s}</li>))}
            </ul>
        );
    }
} 
export default Welcome;
